// Helper function to position labels
const getLabelPosition = (areaId) => {
  const positions = {
    'atlantic-south-america': { x: 100, y: 180 },
    'atlantic-west': { x: 150, y: 120 },
    'atlantic-east': { x: 250, y: 120 },
    'mexico-golfe': { x: 120, y: 200 },
    'mediterranean-sea': { x: 280, y: 150 },
    'atlantic-africa': { x: 300, y: 200 },
    'japan': { x: 450, y: 140 },
    'arctic': { x: 200, y: 30 }
  }
  return positions[areaId] || { x: 0, y: 0 }
}

export default WorldMap
